// ==UserScript==
// @name         KonoSuba Kahoot Theme
// @namespace    https://kahoot-win.herokuapp.com
// @version      1.11
// @description  Get the Useless, the Cannon, the Meat Wall, and the Frog Killer in One Userscript!
// @author       theusaf
// @match        *://kahoot.it/
// @match        *://kahoot.it/v2/*
// @match        *://play.kahoot.it/*
// @exclude      *://play.kahoot.it/v2/assets/*
// @grant        none
// @run-at       document-start
// @downloadURL https://update.greasyfork.org/scripts/399112/KonoSuba%20Kahoot%20Theme.user.js
// @updateURL https://update.greasyfork.org/scripts/399112/KonoSuba%20Kahoot%20Theme.meta.js
// ==/UserScript==

function stuff(){
  const url = window.location.href;
  const page = new XMLHttpRequest();
  const enums = {
    red: "data:image/svg+xml;base64,",
    blue: "data:image/svg+xml;base64,",
    yellow: "data:image/svg+xml;base64,",
    green: "data:image/svg+xml;base64,",
    logo: "data:image/svg+xml;base64,"
  };

  function replacer(){
    // replacements
    const game_logos = Array.from(document.querySelectorAll("[data-functional-selector=\"game-logo\"]"));
    for(logo of game_logos){
      if(logo.style.background){
        continue;
      }
      logo.style.background = `url(${enums.logo}) center center / contain no-repeat`;
      logo.style.width = "25rem";
      logo.style.maxWidth = "25rem";
      try{
        const main = document.querySelector("main");
        if(location.host != "play.kahoot.it"){
          main.children[0].style.width = "25rem";
          main.children[0].style.maxWidth = "25rem";
        }
      }catch(err){}
    }
    const red = document.querySelectorAll("[data-functional-selector=\"answer-0\"]:not([data-mapped-index])");
    const blue = document.querySelectorAll("[data-functional-selector=\"answer-1\"]:not([data-mapped-index])");
    const yellow = document.querySelectorAll("[data-functional-selector=\"answer-2\"]:not([data-mapped-index])");
    const green = document.querySelectorAll("[data-functional-selector=\"answer-3\"]:not([data-mapped-index])");
    red.forEach(function(e){if(e.querySelector("img")){return}e.children[0].innerHTML = `<img src="${enums.red}">`});
    blue.forEach(function(e){if(e.querySelector("img")){return}e.children[0].innerHTML = `<img src="${enums.blue}">`});
    yellow.forEach(function(e){if(e.querySelector("img")){return}e.children[0].innerHTML = `<img src="${enums.yellow}">`});
    green.forEach(function(e){if(e.querySelector("img")){return}e.children[0].innerHTML = `<img src="${enums.green}">`});
    const r2 = document.querySelectorAll("[data-mapped-index=\"0\"]");
    const b2 = document.querySelectorAll("[data-mapped-index=\"1\"]");
    const y2 = document.querySelectorAll("[data-mapped-index=\"2\"]");
    const g2 = document.querySelectorAll("[data-mapped-index=\"3\"]");
    r2.forEach(function(e){if(e.querySelector("img")){return}e.children[0].children[0].innerHTML = `<img src="${enums.red}">`});
    b2.forEach(function(e){if(e.querySelector("img")){return}e.children[0].children[0].innerHTML = `<img src="${enums.blue}">`});
    y2.forEach(function(e){if(e.querySelector("img")){return}e.children[0].children[0].innerHTML = `<img src="${enums.yellow}">`});
    g2.forEach(function(e){if(e.querySelector("img")){return}e.children[0].children[0].innerHTML = `<img src="${enums.green}">`});
    const scoreboard = document.querySelectorAll("[data-functional-selector=\"scoreboard\"]");
    scoreboard.forEach(function(e){
      try{
        const elems = e.children[0].children;
        if(elems[0].querySelector("img")){
          return;
        }
        elems[0].children[1].children[0].children[0].innerHTML = `<img style="height: calc(100% - 1px)" src="${enums.red}">`;
        elems[1].children[1].children[0].children[0].innerHTML = `<img style="height: calc(100% - 1px)" src="${enums.blue}">`;
        elems[2].children[1].children[0].children[0].innerHTML = `<img style="height: calc(100% - 1px)" src="${enums.yellow}">`;
        elems[3].children[1].children[0].children[0].innerHTML = `<img style="height: calc(100% - 1px)" src="${enums.green}">`;
      }catch(err){
        console.log(err);
      }
    });
  }

  const observer = new MutationObserver(replacer);

  observer.observe(document,{
    childList: true,
    subtree: true,
    attributes: true
  });

  window.addEventListener("load",replacer);
}
if(!window.page && !window.kantibotEnabled){
  stuff();
}else{
  window.localStorage.kahootThemeScript = stuff.toString();
}
